import homeIcon from './menu_icon.svg'
function ButtonMenu() {
    return (
        <button><img src={homeIcon} alt='home'/><p>Home</p></button>
    );
  }
export default function MenuBar() {
    return(
        <div className='menuBar'>
            
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        <ButtonMenu/>
        </div>
    )
}
